import '../main.css';


export default function Home(){
    return(
    <div>
        <Header title="Esse é o título"/>
        <Title title="Escolha uma opção abaixo:"/>



        <Sections title="Classificação de Imagem" numero="1"/>
        <Sections title="Detecção de Objetos" numero="2"/>



    </div>


    );
}
